function GitGraphWrapper(){this.gitGraph=new GitGraph,this.branches={},this.head=void 0,this.branch=function(a){var b=this.gitGraph.branch(a);return this.branches[b.name]=b,this},this.checkout=function(a){return this.head=this.branches[a],this.head.checkout(),this},this.commit=function(a){return this.gitGraph.commit(a),this},this.tag=function(a){return this.gitGraph.tag(a),this},this.orphanBranch=function(a){var b=this.gitGraph.orphanBranch(a);return this.branches[b.name]=b,this},this.merge=function(a,b){return this.branches[a].merge(this.head,b),this}}